I've talked a lot about the importance of supporting local and buying black this year, and I have learned to truly support local, we must first know and understand the needs of our community. 

This video features @findwhatsrare founder (and my bestie!) Rachel Aschalew (@queen_rara) speaking with five small business owners to learn what community has meant to them this year and how we can best support the city we love this holiday season.

Even if you don’t live in New York, supporting and donating local keeps our communities rare, and we'd want it no other way!

Businesses featured:
@glamexpressway 
@chillhouse
@31philliplim
@apexforyouth 
@brooklyndop
@almardumbo

Had a very special guest for today’s podcast talk!! @jayshetty thank you for joining me to talk all things podcasts, On Purpose and Think Like a Monk!! 🎧📚

We sat down to share our favorite mindfulness podcasts including lessons from the *one and only* @michelleobama’s podcast AND to learn a little bit about self care from @TyAlexander and her podcast @SelfCareIRL!

